webpackJsonp([0xfb72b86529ce],{7220:function(e,t){e.exports={data:{post:{html:'<p>My wife has the chance to meet supermodel <a title="Heidi Klum GmbH" href="http://www.heidiklum.com/">Heidi Klum</a>, but she\'s turning it down. It\'s not just that she doesn\'t think she is an appropriate spokesperson for her business or that she seems to be "just as blond as she looks". It\'s mostly because her male colleagues can\'t think straight anymore because their tongues are hanging out at the prospect of meeting a real, live supermodel.</p>\n<p>If you care to meet Heidi Klum, she\'ll be doing promotion at the<br />\n<a title="Hamburger Morgenpost" href="http://tinyurl.com/3k3wr">Hamburg ZOB</a> (central bus station) next Wednesday. But don\'t expect to get real close.</p>',fields:{title:"No Klum",date:"31 Jan 2005",url:"https://papascott.de/2005-01-31-no-klum/"}}},pathContext:{slug:"/2005-01-31-no-klum/",prev:{fields:{title:"Plagerism",date:"30 Jan 2005",slug:"/2005-01-30-plagerism/"}},next:{fields:{title:"Dot Com Zombie",date:"02 Feb 2005",slug:"/2005-02-02-dot-com-zombie/"}}}}}});
